import React from 'react';
import './Card.css';
import { Link } from 'react-router-dom';

export default function Card ({min, max, name, img, onClose, id}) {
    return (
      <div class="h-64 bg-gradient-to-r from-green-300  to-green-700">
        <div >
            <button onClick={onClose} class="py-1 px-2 text-white rounded-lg bg-red-500 shadow-lg">X</button>
        </div>
        <div class="text-white">
            <Link to = {`/city/${id}`}>
                <h5 className="card-title">{name}</h5>
            </Link>
          
            <p class=" bg-gradient-to-r from-cyan-300  to-cyan-700">
               Min </p>
              <p>{min}°</p>
            
            <div >
              <p>Max</p>
              <p>{max}°</p>
            </div>
            <div >
              <img className="iconoClima" src={"http://openweathermap.org/img/wn/"+img+"@2x.png"} width="80" height="80" alt="" />
            </div>
          
        </div>
      </div>
    );
};
